import axios from "axios";

const getProducts = () => {
  // const response = await axios.get(`${BASE_URL}/products`);
  // return response.data;
  const BASE_URL = "https://fakestoreapi.com";
  const [url, setUrl] = useState([]);

  useEffect(() => {
    axios
      .get(`${BASE_URL}/products`)
      .then((response) => {
        setUrl(response.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
};

export { getProducts };
